import bannerImage from '/Users/padkas2001gmail.com/Desktop/kurs_web/src/Image/Unknown.png';
import './MainBanner.css';
import '../../index.css'
function MainBanner() {
  return (
    <section className="main-banner">
      <img src={bannerImage} alt="Элитная мебель" className="banner-image" />
      <div className="banner-content">
      </div>
    </section>
  );
}

export default MainBanner;
